import React, { useState } from "react";
import './App.css';

const App = () =>{
    const [name, setName]= useState("");

    const InputEvent =(event)=>{
        setName(event.target.value);

    }
    return(
        <>
        <div>
        <h1>Hello!</h1>
        <input
            type="text" placeholder="enter your name" 
                onChange={InputEvent}
            />



        </div>
            
        </>
    )
}
export default App;
